import React from 'react';
import './index.css';

const Score = ({minScore,maxScore,sofarScore}) => {
    const widthminScore = {
        width: `${minScore}%`
    }
    const widthsoFar = {
        width: `${sofarScore}%`
    }
    const widthmaxScore = {
        width: `${maxScore}%`
    }

    return (
        <div>
<div className="scores">Score: {minScore}&#37; &nbsp;&nbsp;&nbsp;&nbsp; MaxScore: {maxScore}&#37;</div>
        <div className="slidebar">
            <div className="maxScore" style={widthmaxScore}>
            </div>
            <div className="sofarScore" style={widthsoFar}>
            </div>
            <div className="minScore" style={widthminScore}>
            </div>
        </div>
        </div>
    );
}


export default Score;
